// Contains the Mechaduino parameter defintions

#include "Parameters.h"

#include <Wire.h>

#include "Utils.h"
#include "anti_cogging.h"
#include "math.h"

//----Current Parameters-----
#ifdef USE_10_BIT
#define RESOLUTION 1023
#else
#define RESOLUTION 255
#endif

#if SAMPLE_ON_REQUEST
const int Fs = HAPTIC_LOOP_FREQ;  // Expected external clk
#else
const int Fs = FPID_FREQ;  // Sample frequency in Hz
#endif


// position mode PID values.

volatile float pKp  = 150;
volatile float pKi  = 0.1;
volatile float pKd  = 0;
volatile float pLPF = 200;  // break frequency in hertz

volatile float vKp = 1.2;  // velocity mode PID values.  Depending on your motor/load/desired performance, you will need
                           // to tune these values.  You can also implement your own control scheme
volatile float vKi  = 0.015;
volatile float vKd  = 0.1;
volatile float vLPF = 50.0;  // break frequency in hertz

volatile float pLPFa = exp(pLPF * -2 * 3.14159 / Fs);  // z = e^st pole mapping
volatile float pLPFb = (1.0 - pLPFa);
volatile float vLPFa = exp(vLPF * -2 * 3.14159 / Fs);  // z = e^st pole mapping
volatile float vLPFb = (1.0 - vLPFa) * Fs * 0.16666667;

// Fixed point variables
fixed_point_t fixed_180     = float_to_fixed(180);
fixed_point_t fixed_neg_180 = float_to_fixed(-180);
fixed_point_t fixed_360     = float_to_fixed(360);
fixed_point_t vLPFa_fixed   = float_to_fixed(vLPFa);
fixed_point_t vLPFb_fixed   = float_to_fixed(vLPFb);

const int   spr       = 200;  // 200 steps per revolution  -- for 400 step/rev, you should only need to edit this value
const float aps       = 360.0 / spr;  // angle per step
int         cpr       = 16384;        // counts per rev
const float stepangle = aps / 32.0;   // for step/dir interrupt: aps/32 is the equivalent of 1/32 microsteps

// volatile float PA = aps / 4;  // Phase advance...aps = 1.8 for 200 steps per rev, 0.9 for 400
volatile float PA = aps;

const float iMAX = 1.5;  // Be careful adjusting this.  While the A4954 driver is rated for 2.0 Amp peak currents, it
                         // cannot handle these currents continuously.  Depending on how you operate the Mechaduino, you
                         // may be able to safely raise this value...please refer to the A4954 datasheet for more info
const float  rSense = 0.150;
volatile int uMAX =
    (RESOLUTION / 3.3) * (iMAX * 10 * rSense);  // 255 for 8-bit pwm, 1023 for 10 bit, must also edit analogFastWrite

bool use_anti_cogg = false;

